import { Component } from '@angular/core';
import { NavController, AlertController} from 'ionic-angular';
import { LoginPage } from '../login/login';
import { Camera, CameraOptions } from '@ionic-native/camera'
import { ProductsService } from '../../app/services/services';

@Component({
  selector: 'page-register',
  templateUrl: 'register.html'
})
export class RegisterPage {
  createSuccess = false;
  registerCredentials = {email: '', password: ''};
  myPhoto:any = "data:image/jpeg;base64,";
  myFile: any;

  constructor(private nav: NavController, 
    private alertCtrl: AlertController,
    private camera: Camera,
    private productsService:ProductsService) {
    this.myFile = this.dataURItoBlob(this.myPhoto);
  }

  register(registerForm) {
    var valid = 0;
    if(registerForm.name == null || registerForm.name == ""){
      this.valPopup("Error:", "Ingrese nombre completo.");
      valid = 1;
    }
    if(registerForm.email == null || registerForm.email == ""){
      this.valPopup("Error:", "Ingrese email.");
      valid = 1;
    }else{
      if(this.validateEmail(registerForm.email)){

      }else{
        this.valPopup("Error:", "Email incorrecto.");
        valid = 1;
      }
    }
    if(registerForm.password == null || registerForm.password == ""){
      this.valPopup("Error:", "Ingrese password.");
      valid = 1;
    }else{
      if(this.validateStrength(registerForm.password)){

      }else{
        this.valPopup("Error:", "El password debe tener almenos 8 Caracteres, un nmero, un caracter especial y una letra en mayscula y una minscula.");
        valid = 1;
      }
    }

    if(registerForm.password1 == null || registerForm.password1 == ""){
      this.valPopup("Error:", "Ingrese confirmacin de password.");
      valid = 1;
    }else{
      if(registerForm.password1 == registerForm.password){

      }else{
        this.valPopup("Error:", "Los campos Password y Confirmacin de Password deben ser iguales.");
        valid = 1;
      }
    }

    if(registerForm.numeroCelular == null || registerForm.numeroCelular == ""){
      this.valPopup("Error:", "Ingrese nmero celular.");
      valid = 1;
    }else{
      if(registerForm.numeroCelular.length == 10){
        if(this.validateCell(registerForm.numeroCelular)){

        }else{
          this.valPopup("Error:", "El nmero celular debe contener 10 dgitos.");
          valid = 1;
        }
      }else{
        this.valPopup("Error:", "El nmero celular debe contener 10 dgitos.");
        valid = 1;
      }

    }

    if(valid == 0){
      console.log(JSON.stringify(registerForm));
      this.productsService.registerUser(registerForm, this.myFile).subscribe(response => {
        console.log(JSON.stringify(response));
        this.createSuccess = true;
        this.showPopup("Exito!", "Se ha creado su cuenta correctamente.");
      });
    }

  }

  showPopup(title, text) {
    let alert = this.alertCtrl.create({
      title: title,
      subTitle: text,
      buttons: [
        {
          text: 'OK',
          handler: data => {
            if (this.createSuccess) {
              this.nav.popToRoot();
            }
          }
        }
      ]
    });
    alert.present();
  }

  valPopup(title, text) {
    let alert = this.alertCtrl.create({
      title: title,
      subTitle: text,
      buttons: [{text: 'OK', handler: data => {}}]
    });
    alert.present();
  }

  public goToLogin() {
    this.nav.push(LoginPage);
  }

  cropImage(){
    const options: CameraOptions = {
      quality: 80,
      destinationType: this.camera.DestinationType.DATA_URL,
      sourceType: this.camera.PictureSourceType.PHOTOLIBRARY,
      saveToPhotoAlbum: false,
      allowEdit: true,
      targetWidth: 300,
      targetHeight: 300
    }

    this.camera.getPicture(options).then((imageData) => {
      this.myPhoto = 'data:image/jpeg;base64,' + imageData;
      this.myFile = this.dataURItoBlob(this.myPhoto);
    }, (err) =>{

    });

  }

  dataURItoBlob(dataURI) {
    var binary = atob(dataURI.split(',')[1]);
    var array = [];
    for(var i = 0; i < binary.length; i++) {
        array.push(binary.charCodeAt(i));
    }
    return new Blob([new Uint8Array(array)], {type: 'image/jpeg'});
  }

  validateEmail(email) {
    var re = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    return re.test(email);
  }

  validateStrength(password){
    var re = /^(?=.*[a-z])(?=.*[A-Z])(?=.*[0-9])(?=.*[!@#\$%\^&\*])(?=.{8,})/;
    return re.test(password);
  }

  validateCell(cell){
    var re = /([0-9]){10,10}/g;
    return re.test(cell);
  }

}
